#   https://leetcode.com/problems/valid-anagram
#   92.91%

#   https://leetcode.com/problems/valid-anagram/solution


class Solution:
    def isAnagram(self, s, t):
        if (s and t is None) or (s is None and t) or len(s) != len(t):
            return False
        if 0 == len(s) == len(t):
            return True
        d = {}
        for c in s:
            if c in d:
                d[c] += 1
            else:
                d[c] = 1
        for c in t:
            if c in d:
                d[c] -= 1
            else:
                return False
        return all([i == 0 for i in d.values()])


solution = Solution()
data = [('anagram', 'nagaram', True),
        ('rat', 'car', False),
        ('', '', True),
        ("",
        "",
        False),
        ]
for s, t, expected in data:
    real = solution.isAnagram(s, t)
    if len(s) < 10 and len(t) < 10:
        print('{}, {}, expected {}, real {}, result {}'.format(s, t, expected, real, expected == real))
    else:
        print('expected {}, real {}, result {}'.format(expected, real, expected == real))
